 (function() {
 // Initialize dataLayer
 window.dataLayer = window.dataLayer || [];

 // Wait for GTM to be ready
 window.dataLayer.push({
 'event': 'gtm_loaded',
 'gtm_container_id': 'GTM-MWQNDPQ2'
 });

 // Ensure GCLID is captured on page load
 const urlParams = new URLSearchParams(window.location.search);
 const gclid = urlParams.get('gclid');

 if (gclid) {
 // Store gclid for conversion tracking
 localStorage.setItem('gclid', gclid);

 // Set expiration time (30 days from now)
 const expirationDate = new Date();
 expirationDate.setDate(expirationDate.getDate() + 30);
 localStorage.setItem('gclidExpiration', expirationDate.toString());

 // Store gclid in first-party cookie
 document.cookie = 'gclid=' + gclid + '; expires=' + expirationDate.toUTCString() + '; path=/; SameSite=Lax';

 // Push to dataLayer for GTM
 window.dataLayer.push({
 'gclid': gclid,
 'event': 'gclid_captured'
 });
 }

 // Initialize tracking functions
 if (typeof window.initializeGlobalTracking === 'function') {
 window.initializeGlobalTracking();
 }
 })();
