self.__next_f.push([1,"
 (function() {
 // Helper function to get GCLID from URL or storage
 function getGclid() {
 try {
 // First try from URL
 const urlParams = new URLSearchParams(window.location.search);
 const gclid = urlParams.get('gclid');

 if (gclid) return gclid;

 // Then try from localStorage
 const storedGclid = localStorage.getItem('gclid');
 const expiration = localStorage.getItem('gclidExpiration');

 if (storedGclid && expiration && new Date(expiration) > new Date()) {
 return storedGclid;
 }
 } catch (e) {
 console.error('Error getting GCLID:', e);
 }

 return '';
 }

 // Make GCLID accessible globally if not already defined
 if (typeof window.getGclid !== 'function') {
 window.getGclid = getGclid;
 }

 // Push GCLID to dataLayer if available
 if (window.dataLayer && typeof getGclid === 'function') {
 const gclid = getGclid();
 if (gclid) {
 window.dataLayer.push({
 'gclid': gclid
 });
 }
 }
 })();
